import React from 'react';
import {Box, CloseButton, Divider, HStack, Input, Spacer, Text, VStack} from "@chakra-ui/react";
import {AiOutlineUsergroupAdd, MdPublic} from "react-icons/all";
import {CopyIcon} from "@chakra-ui/icons";

function MdOutlinePublic() {
    return null;
}

const ShareDialog = ({setVisible}) => {
    return (
        <>
            <Box bg={'gray.400'}
                 opacity={.8}
                 position={'fixed'}
                 top={0} minH={'100vh'}
                 right={0}
                 onClick={() => setVisible(false)}
                 minW={'100vw'}
                 zIndex={900}>

            </Box>
            <Box p={5} w={500} bg={'white'}
                 borderRadius={'md'}
                 boxShadow={'md'}
                 transform={"translate(50%,-50%)"}
                 position={'fixed'} top={'30%'} right={'50%'} height={300} zIndex={901}>
               <VStack spacing={5} w={'100%'}>
                   <HStack w={'100%'}>
                       <AiOutlineUsergroupAdd/>
                       <Text>Invite</Text>
                       <Spacer/>
                       <CloseButton size={'md'}/>
                   </HStack>
                   <HStack w={'100%'}>
                       <MdPublic size={25}/>
                       <Input

                       />
                       <CopyIcon size={25}/>
                   </HStack>
               </VStack>
            </Box>
        </>
    );
};

export default ShareDialog;
